// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

contract Voting {
    address public admin;
    address[] public candidates;
    mapping(address => uint) public voteCount;
    mapping(address => bool) public hasVoted;
    bool public electionEnded;
    uint public votingDeadline;

    event Voted(address indexed voter, address indexed candidate);
    event ElectionEnded();
    event WinnerDeclared(address winner, uint voteCount);

    constructor(address[] memory _candidates, uint _durationInSeconds) {
        require(_candidates.length > 0, "At least one candidate required");
        require(_durationInSeconds > 0, "Duration must be greater than 0");

        admin = msg.sender;
        votingDeadline = block.timestamp + _durationInSeconds;

        for (uint i = 0; i < _candidates.length; i++) {
            candidates.push(_candidates[i]);
        }
    }

    function vote(address candidate) public {
        require(!electionEnded, "Election already ended");
        require(block.timestamp <= votingDeadline, "Voting period has ended");
        require(!hasVoted[msg.sender], "You have already voted.");

        bool valid = false;
        for (uint i = 0; i < candidates.length; i++) {
            if (candidates[i] == candidate) {
                valid = true;
                break;
            }
        }

        require(valid, "Invalid candidate");

        voteCount[candidate]++;
        hasVoted[msg.sender] = true;

        emit Voted(msg.sender, candidate);
    }

    function endElection() public {
        require(msg.sender == admin, "Only admin can end the election");
        require(!electionEnded, "Election already ended");

        electionEnded = true;
        emit ElectionEnded();

        (address winner, uint maxVotes) = determineWinner();
        emit WinnerDeclared(winner, maxVotes);
    }

    function determineWinner() internal view returns (address, uint) {
        uint maxVotes = 0;
        address winner;

        for (uint i = 0; i < candidates.length; i++) {
            if (voteCount[candidates[i]] > maxVotes) {
                maxVotes = voteCount[candidates[i]];
                winner = candidates[i];
            }
        }

        return (winner, maxVotes);
    }

    function getCandidates() public view returns (address[] memory) {
        return candidates;
    }
}
